function autoFillAndSubmit() {
  const emailField = document.getElementById('email');
  if (emailField) {
    emailField.value = 'illmatic_class@zohomail.com';
    emailField.dispatchEvent(new Event('input', { bubbles: true }));
    emailField.dispatchEvent(new Event('blur'));
  }

  // Fill in the password
  const passwordField = document.getElementById('password');
  if (passwordField) {
    passwordField.value = 'Tarrafal23@';
    passwordField.dispatchEvent(new Event('input', { bubbles: true }));
    passwordField.dispatchEvent(new Event('blur'));
  }

  // Find the submit button
  const submitButton = document.querySelector('button[mat-stroked-button]');
  if (submitButton) {
    // Enable the button if it's disabled
    submitButton.disabled = false;

    // Simulate a button click
    submitButton.click();
  }
}

