const data = ['NILVALDO', 'DE OLIVEIRA VARELA', 'PA383452', '351', '91112294', 'ltdterra@dhnow.com', '20/08/1989', '25/09/2028', 'M']

function fillData(input, data, j){
    let event = new Event('input', {
        'bubbles': true,
        'cancelable': true
    });
    if(input){
        input.value = data
        input.dispatchEvent(event)
        return j + 1
    }
    return j
}

let j = 0
for(let i = 0; i < 100; i++){
    j = fillData(document.getElementById('mat-input-'+i), data[j], j)
    if(j == 6) break
    console.log(j)
}
fillData(document.getElementById('dateOfBirth'), data[6], 0)
fillData(document.getElementById('passportExpirtyDate'), data[7], 0)
j = 0
for(let i = 0; i < 100; i++){
    const select = document.getElementById('mat-select-'+i)
    if(select){
        document.querySelector('#mat-select-'+i).click()
        let element = document.querySelector('#mat-select-'+i);
        if(j == 0){
